import { useState } from "react";
import Sidebar from "./Components/Sidebar";
import Steps from "./Components/Steps";
import UploadSection from "./Components/FileUpload";

function App() {
  const [activeStep, setActiveStep] = useState(1);

  return (
    <div className="flex h-screen">
      {/* Sidebar Navigation */}
      <Sidebar />

      {/* Main Content */}
      <div className="flex-1 p-8 bg-white">
        <h1 className="text-3xl font-bold">SDTM Mapping Tool</h1>
        <p className="text-gray-600 mt-2">
          This application helps you map XPT files to SDTM domains using LLM-powered analysis. 
          Upload your XPT files, and the tool will automatically identify domains, create mappings, 
          and generate the necessary documentation.
        </p>

        {/* Steps Navigation */}
        <Steps activeStep={activeStep} setActiveStep={setActiveStep} />

        {/* File Upload Section */}
        <UploadSection />
      </div>
    </div>
  );
}

export default App;
